using FluentNHibernate.Mapping;using Ovi.Task.Data.Entity;namespace Ovi.Task.Data.Mapping{    public sealed class TMCUBES_MAP : ClassMap<TMCUBES>    {        public TMCUBES_MAP()        {            Id(x => x.CUB_ID);            Map(x => x.CUB_GRID);            Map(x => x.CUB_DESC);            Map(x => x.CUB_DEFAULT);            Map(x => x.CUB_USER);            Map(x => x.CUB_FILTER);        }    }}